import React, { Component } from 'react'

import ee from '../../utils/Events'
export default class Box3 extends Component {
    constructor(){
        super();
        this.state = {
            inf
        }
    }
    render() {
        ee.on('Boxmessage',(e)=>{
            this.setState({info:e});
        })
        return (
            <div>
                box3
            </div>
        )
    }
}
